import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import GroupCard from '../Card/GroupCard';
import Slideshow from '../Slideshow/Slideshow';



const Home = () => {
    return (
        <div>
            <Top />
     <Slideshow />
<GroupCard />
<Bottom />
        </div>
    );
};

export default Home;
